import React from "react";

import "./style.css";

import Product from "../Product";

const StyleView = ( props ) =>{

    const { cartImg, productList } = props

    console.log(productList)

    return(
        <div>
            <div className="ui-mask"></div>
            <div className="pop-mask">
                <div className="pro-info">
                    <div className="pro-img">
                        <img src={cartImg} alt=""></img>
                    </div>
                    <div className="pro-desc">
                        <div className="pro-price">
                            <span className="pro-price-cur">￥9999</span>
                            <span className="pro-price-origin">￥123</span>
                        </div>
                        <div className="pro-name">
                            <span>小米净水器</span>
                        </div>
                    </div>
                </div>
                {
                    productList && productList.length > 0 ? <>{
                        productList.map(el=>{
                            return(<div key={el.id}>
                                <Product title={el.title} label={el.label_list}/>
                            </div>)
                        })
                     }</> : ''
                }
                <div className="pro-quantity">
                    《
                    <span>购买数量</span>
                </div>
            </div>
        </div>
    )
}

export default StyleView
